CREATE TABLE IF NOT EXISTS Movie_Rental (
    `ID` INT,
    `Movie_Title` VARCHAR(87) CHARACTER SET utf8,
    `Genres` VARCHAR(64) CHARACTER SET utf8,
    `Content_Rating` VARCHAR(9) CHARACTER SET utf8,
    `Duration` VARCHAR(3) CHARACTER SET utf8,
    `Year` VARCHAR(4) CHARACTER SET utf8,
    `Director` VARCHAR(32) CHARACTER SET utf8,
    `IMDB_Link` VARCHAR(52) CHARACTER SET utf8,
    `Critical_Rating` NUMERIC(2, 1),
    `Price` INT,
    `Stock` INT,
    `NumOrders` INT
);
